    ap_sync_reg_channel_write_sobel_buf_grad_assign_proc : process(ap_clk)
    begin
        if (ap_clk'event and ap_clk =  '1') then
            if (ap_rst_n_inv = '1') then
                ap_sync_reg_channel_write_sobel_buf_grad <= ap_const_logic_0;
            else
                if (((sobel_U0_ap_done and sobel_U0_ap_continue) = ap_const_logic_1)) then 
                    ap_sync_reg_channel_write_sobel_buf_grad <= ap_const_logic_0;
                else 
                    ap_sync_reg_channel_write_sobel_buf_grad <= ap_sync_channel_write_sobel_buf_grad;
                end if; 
            end if;
        end if;
    end process;


    ap_sync_reg_channel_write_sobel_buf_value_assign_proc : process(ap_clk)
    begin
        if (ap_clk'event and ap_clk =  '1') then
            if (ap_rst_n_inv = '1') then
                ap_sync_reg_channel_write_sobel_buf_value <= ap_const_logic_0;
            else
                if (((sobel_U0_ap_done and sobel_U0_ap_continue) = ap_const_logic_1)) then 
                    ap_sync_reg_channel_write_sobel_buf_value <= ap_const_logic_0;
                else 
                    ap_sync_reg_channel_write_sobel_buf_value <= ap_sync_channel_write_sobel_buf_value;
                end if; 
            end if;
        end if;
    end process;

    ap_channel_done_gau_buf <= gau6_U0_ap_done;
    ap_channel_done_sobel_buf_grad <= (sobel_U0_ap_done and (ap_sync_reg_channel_write_sobel_buf_grad xor ap_const_logic_1));
    ap_channel_done_sobel_buf_value <= (sobel_U0_ap_done and (ap_sync_reg_channel_write_sobel_buf_value xor ap_const_logic_1));
    ap_done <= nms_U0_ap_done;
    ap_idle <= (sobel_U0_ap_idle and nms_U0_ap_idle and gau6_U0_ap_idle and (sobel_buf_grad_t_empty_n xor ap_const_logic_1) and (sobel_buf_value_t_empty_n xor ap_const_logic_1) and (gau_buf_t_empty_n xor ap_const_logic_1));
    ap_ready <= gau6_U0_ap_ready;

    ap_rst_n_inv_assign_proc : process(ap_rst_n)
    begin
                ap_rst_n_inv <= not(ap_rst_n);
    end process;

    ap_sync_channel_write_sobel_buf_grad <= ((sobel_U0_out_1_full_n and ap_channel_done_sobel_buf_grad) or ap_sync_reg_channel_write_sobel_buf_grad);
    ap_sync_channel_write_sobel_buf_value <= ((sobel_U0_out_0_full_n and ap_channel_done_sobel_buf_value) or ap_sync_reg_channel_write_sobel_buf_value);
    ap_sync_continue <= ap_const_logic_1;
