    gau6_U0_start_full_n <= ap_const_logic_1;
    gau6_U0_start_write <= ap_const_logic_0;
    nms_U0_ap_continue <= ap_const_logic_1;
    nms_U0_ap_start <= (sobel_buf_value_t_empty_n and sobel_buf_grad_t_empty_n);
    nms_U0_start_full_n <= ap_const_logic_1;
